func getSafeReportCount(reports []string) (int, error) {
	var count int
	for i, report := range reports {
		var levels []int
		for j, level := range strings.Fields(report) {
			num, err := strconv.Atoi(level)
			if err != nil {
				return 0, fmt.Errorf("failed to parse %s (%d,%d) as int: %w", level, i, j, err)
			}
			levels = append(levels, num)
		}

		if isSafe(levels) {
			count++
		}
	}
	return count, nil
}

func isSafe(levels []int) bool {
	safe := true

	direction := "increasing"
	if levels[1] < levels[0] {
		direction = "decreasing"
	}

	for i := 1; i < len(levels); i++ {
		diff := math.Abs(float64(levels[i] - levels[i-1]))
		if diff < 1 || diff > 3 {
			safe = false
			break
		}

		if (levels[i] > levels[i-1] && direction == "decreasing") ||
			(levels[i] < levels[i-1] && direction == "increasing") {
			safe = false
			break
		}
	}
	return safe
}
